import React, { useEffect, useState, useRef } from 'react';
import { HeartPulse } from 'lucide-react';
import { useAppState } from '../../context/AppStateContext';

const PulseCheckButton = () => {
  const { 
    activeSection, 
    pulseCheckTime, 
    pauseTime,
    pulseFlashing,
    showChargeMonitor,
    handlePulseCheckClick, 
    COLORS 
  } = useAppState();

  const [progressWidth, setProgressWidth] = useState(0);
  const [isFlashing, setIsFlashing] = useState(false);
  // 1:45 in seconds (from 2:00 to 0:15)
  const TOTAL_PULSE_TIME = 105; 

  // Using useRef to force re-render for flashing effect
  const forceUpdate = useRef(0);
  useEffect(() => {
    let interval;
    if (isFlashing) {
      interval = setInterval(() => {
        forceUpdate.current = Date.now();
      }, 500); // Update every 500ms for the flashing effect
    }
    return () => {
      if (interval) clearInterval(interval);
    };
  }, [isFlashing]);

  // Update progress width and flashing state based on remaining time
  useEffect(() => {
    if (activeSection === 'pulse' || activeSection === 'pulse+metronome') {
      // Main countdown from 2:00 to 0:15
      if (pulseCheckTime >= 15) { 
        // Calculate progress percentage from start (2:00) to reach 100% at 0:15
        const timeElapsed = 120 - pulseCheckTime;
        const progressPercentage = (timeElapsed / 105) * 100;
        setProgressWidth(Math.min(progressPercentage, 100)); // Cap at 100%
        setIsFlashing(false);
      } 
      // From 0:15 to 0:10, keep full blue background
      else if (pulseCheckTime >= 10) {
        setProgressWidth(100);
        setIsFlashing(false);
      }
      // From 0:10 to 0:00, keep full blue background but flash text
      else if (pulseCheckTime > 0) {
        setProgressWidth(100);
        setIsFlashing(true);
      }
      // During the 10s pause, keep full blue background
      else {
        setProgressWidth(100);
        setIsFlashing(false);
      }
    } else {
      // Reset when not active
      setProgressWidth(0);
      setIsFlashing(false);
    }
  }, [activeSection, pulseCheckTime, forceUpdate.current]);

  // Common button styles
  const buttonBaseStyle = {
    border: 'none',
    borderRadius: '8px',
    padding: '12px',
    cursor: 'pointer',
    textAlign: 'left',
    position: 'relative',
    width: '100%',
    height: '84px',
    transition: 'all 0.2s ease',
    boxShadow: '0 2px 4px rgba(0,0,0,0.2)',
    overflow: 'hidden', // Important to contain the progress bar
  };

  const isActive = activeSection === 'pulse' || activeSection === 'pulse+metronome';

  // Determine text color based on state
  const getTextColor = () => {
    if (!isActive) return COLORS.pulseBlue; // Inactive state
    if (isFlashing) {
      // Flashing between blue and white (during 0:10 to 0:00)
      return Date.now() % 1000 < 500 ? COLORS.pulseBlue : COLORS.white;
    }
    return COLORS.white; // Default active state text color
  };

  return (
    <button
      onClick={handlePulseCheckClick}
      style={{
        ...buttonBaseStyle,
        backgroundColor: showChargeMonitor 
          ? COLORS.pulseBlue 
          : COLORS.background,
        color: isActive 
          ? COLORS.white 
          : COLORS.pulseBlue,
        border: isActive 
          ? 'none' 
          : `1px solid ${COLORS.pulseBlue}`,
        animation: pulseFlashing ? 'flashAlternate 1s infinite' : 'none'
      }}
    >
      {/* Progress bar */}
      {isActive && (
        <div 
          style={{
            position: 'absolute',
            top: 0,
            left: 0,
            height: '100%',
            width: `${progressWidth}%`,
            backgroundColor: COLORS.pulseBlue,
            transition: 'width 1s linear',
            zIndex: 1
          }}
        />
      )}

      {/* Button content - positioned above the progress bar */}
      <div style={{ 
        display: 'flex', 
        alignItems: 'center', 
        height: '100%',
        position: 'relative',
        zIndex: 2, // Ensure content stays above the progress bar
        color: getTextColor()
      }}>
        <div style={{ marginRight: '15px', display: 'flex', alignItems: 'center' }}>
          <HeartPulse size={42} />
        </div>
        <div>
          <div style={{ fontSize: '18px', fontWeight: 'bold', marginBottom: '2px' }}>
            Pulse Check
          </div>
          <div style={{ fontSize: '14px', fontWeight: 'bold', opacity: 0.9 }}>
            2-min countdown
          </div>
        </div>
      </div>

      {isActive && (
        <div style={{ 
          position: 'absolute',
          right: '12px',
          top: '50%',
          transform: 'translateY(-50%)',
          fontSize: '22px',
          fontWeight: 'bold',
          zIndex: 2, // Ensure timer stays above the progress bar
          color: getTextColor()
        }}>
          {pulseCheckTime > 0 ? (
            // Main countdown display
            <div>
              {Math.floor(pulseCheckTime / 60)}:{(pulseCheckTime % 60).toString().padStart(2, '0')}
            </div>
          ) : (
            // Pause countdown display
            <div>
              {Math.floor(pauseTime / 60)}:{(pauseTime % 60).toString().padStart(2, '0')}
            </div>
          )}
        </div>
      )}
    </button>
  );
};

export default PulseCheckButton;
